INSERT INTO `SYSTEM_VARIABLES` (`VARIABLE_NAME`, `SESSION_VALUE`, `GLOBAL_VALUE`, `GLOBAL_VALUE_ORIGIN`, `DEFAULT_VALUE`, `VARIABLE_SCOPE`, `VARIABLE_TYPE`, `VARIABLE_COMMENT`, `NUMERIC_MIN_VALUE`, `NUMERIC_MAX_VALUE`, `NUMERIC_BLOCK_SIZE`, `ENUM_VALUE_LIST`, `READ_ONLY`, `COMMAND_LINE_ARGUMENT`) VALUES
('INNODB_FORCE_RECOVERY', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT UNSIGNED', 'Helps to save your data in case the disk image of the database becomes corrupt.', '0', '6', '0', NULL, 'YES', 'REQUIRED'),
('PERFORMANCE_SCHEMA', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enable the performance schema.', NULL, NULL, NULL, 'OFF,ON', 'YES', 'OPTIONAL'),
('SQL_MODE', '', 'STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', 'COMPILE-TIME', 'STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', 'SESSION', 'SET', 'Sets the sql mode', NULL, NULL, NULL, 'REAL_AS_FLOAT,PIPES_AS_CONCAT,ANSI_QUOTES,IGNORE_SPACE,IGNORE_BAD_TABLE_OPTIONS,ONLY_FULL_GROUP_BY,NO_UNSIGNED_SUBTRACTION,NO_DIR_IN_CREATE,POSTGRESQL,ORACLE,MSSQL,DB2,MAXDB,NO_KEY_OPTIONS,NO_TABLE_OPTIONS,NO_FIELD_OPTIONS,MYSQL323,MYSQL40,ANSI,NO_AUTO_VALUE_ON_ZERO,NO_BACKSLASH_ESCAPES,STRICT_TRANS_TABLES,STRICT_ALL_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ALLOW_INVALID_DATES,ERROR_FOR_DIVISION_BY_ZERO,TRADITIONAL,NO_AUTO_CREATE_USER,HIGH_NOT_PRECEDENCE,NO_ENGINE_SUBSTITUTION,PAD_CHAR_TO_FULL_LENGTH', 'NO', 'REQUIRED'),
('PERFORMANCE_SCHEMA_EVENTS_WAITS_HISTORY_LONG_SIZE', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'BIGINT', 'Number of rows in EVENTS_WAITS_HISTORY_LONG. Use 0 to disable, -1 for automated sizing.', '-1', '1048576', '1', NULL, 'YES', 'REQUIRED'),
('MYISAM_USE_MMAP', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Use memory mapping for reading and writing MyISAM tables', NULL, NULL, NULL, 'OFF,ON', 'NO', 'NONE'),
('PERFORMANCE_SCHEMA_MAX_COND_CLASSES', NULL, '80', 'COMPILE-TIME', '80', 'GLOBAL', 'BIGINT UNSIGNED', 'Maximum number of condition instruments.', '0', '256', '1', NULL, 'YES', 'REQUIRED'),
('SLAVE_RUN_TRIGGERS_FOR_RBR', NULL, 'NO', 'COMPILE-TIME', 'NO', 'GLOBAL', 'ENUM', 'Modes for how triggers in row-base replication on slave side will be executed. Legal values are NO (default), YES and LOGGING. NO means that trigger for RBR will not be running on slave. YES and LOGGING means that triggers will be running on slave, if there was not triggers running on the master for the statement. LOGGING also means results of that the executed triggers work will be written to the binlog.', NULL, NULL, NULL, 'NO,YES,LOGGING', 'NO', 'REQUIRED'),
('PERFORMANCE_SCHEMA_MAX_COND_INSTANCES', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'BIGINT', 'Maximum number of instrumented condition objects. Use 0 to disable, -1 for automated sizing.', '-1', '1048576', '1', NULL, 'YES', 'REQUIRED'),
('VERSION', NULL, '10.2.14-MariaDB-10.2.14+maria~xenial', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'Server version number. It may also include a suffix with configuration or build information. -debug indicates debugging support was enabled on the server, and -log indicates at least one of the binary log, general log or slow query log are enabled, for example 10.1.1-MariaDB-mariadb1precise-log.', NULL, NULL, NULL, NULL, 'YES', NULL),
('PERFORMANCE_SCHEMA_MAX_RWLOCK_CLASSES', NULL, '40', 'COMPILE-TIME', '40', 'GLOBAL', 'BIGINT UNSIGNED', 'Maximum number of rwlock instruments.', '0', '256', '1', NULL, 'YES', 'REQUIRED'),
('INNODB_FLUSH_LOG_AT_TIMEOUT', NULL, '1', 'COMPILE-TIME', '1', 'GLOBAL', 'INT UNSIGNED', 'Write and flush logs every (n) second.', '0', '2700', '0', NULL, 'NO', 'OPTIONAL'),
