('INNODB_DISABLE_SORT_FILE_CACHE', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Whether to disable OS system file cache for sort I/O', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('INIT_FILE', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Read SQL commands from this file at startup', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED'),
('INNODB_ENCRYPTION_ROTATION_IOPS', NULL, '100', 'COMPILE-TIME', '100', 'GLOBAL', 'INT UNSIGNED', 'Use this many iops for background key rotation', '0', '4294967295', '0', NULL, 'NO', 'REQUIRED');
INSERT INTO `SYSTEM_VARIABLES` (`VARIABLE_NAME`, `SESSION_VALUE`, `GLOBAL_VALUE`, `GLOBAL_VALUE_ORIGIN`, `DEFAULT_VALUE`, `VARIABLE_SCOPE`, `VARIABLE_TYPE`, `VARIABLE_COMMENT`, `NUMERIC_MIN_VALUE`, `NUMERIC_MAX_VALUE`, `NUMERIC_BLOCK_SIZE`, `ENUM_VALUE_LIST`, `READ_ONLY`, `COMMAND_LINE_ARGUMENT`) VALUES
('INNODB_DEFRAGMENT', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enable/disable InnoDB defragmentation (default FALSE). When set to FALSE, all existing defragmentation will be paused. And new defragmentation command will fail.Paused defragmentation commands will resume when this variable is set to true again.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'REQUIRED'),
('HAVE_DYNAMIC_LOADING', NULL, 'YES', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'If the server supports dynamic loading of plugins, will be set to YES, otherwise will be set to NO.', NULL, NULL, NULL, NULL, 'YES', NULL),
('PERFORMANCE_SCHEMA_MAX_FILE_HANDLES', NULL, '32768', 'COMPILE-TIME', '32768', 'GLOBAL', 'BIGINT UNSIGNED', 'Maximum number of opened instrumented files.', '0', '1048576', '1', NULL, 'YES', 'REQUIRED'),
('WSREP_SST_METHOD', NULL, 'rsync', 'COMPILE-TIME', 'rsync', 'GLOBAL', 'VARCHAR', 'State snapshot transfer method', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED'),
('SKIP_NETWORKING', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Don''t allow connection with TCP/IP', NULL, NULL, NULL, 'OFF,ON', 'YES', 'OPTIONAL'),
('INNODB_PRINT_ALL_DEADLOCKS', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Print all deadlocks to MariaDB error log (off by default)', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('QUERY_CACHE_WLOCK_INVALIDATE', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'Invalidate queries in query cache on LOCK for write', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('INNODB_STATS_TRADITIONAL', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Enable traditional statistic calculation based on number of configured pages (default true)', NULL, NULL, NULL, 'OFF,ON', 'NO', 'REQUIRED'),
('HAVE_GEOMETRY', NULL, 'YES', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'If the server supports spatial data types, will be set to YES, otherwise will be set to NO.', NULL, NULL, NULL, NULL, 'YES', NULL),
('OLD', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'Use compatible behavior from previous MariaDB version. See also --old-mode', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('UNIQUE_CHECKS', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'If set to 1, the default, secondary indexes in InnoDB tables are performed. If set to 0, storage engines can (but are not required to) assume that duplicate keys are not present in input data. Set to 0 to speed up imports of large tables to InnoDB. The storage engine will still issue a duplicate key error if it detects one, even if set to 0.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL),
('INNODB_MAX_DIRTY_PAGES_PCT', NULL, '75.000000', 'COMPILE-TIME', '75.000000', 'GLOBAL', 'DOUBLE', 'Percentage of dirty pages allowed in bufferpool.', '0', '99.999', NULL, NULL, 'NO', 'REQUIRED'),
('WSREP_RESTART_SLAVE', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Should MariaDB slave be restarted automatically, when node joins back to cluster', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('WSREP_PATCH_VERSION', NULL, 'wsrep_25.23', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'Wsrep patch version, for example wsrep_25.10.', NULL, NULL, NULL, NULL, 'YES', NULL),
('PLUGIN_DIR', NULL, '/usr/lib/mysql/plugin/', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Directory for plugins', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED'),
('KEY_BUFFER_SIZE', NULL, '16777216', 'CONFIG', '134217728', 'GLOBAL', 'BIGINT UNSIGNED', 'The size of the buffer used for index blocks for MyISAM tables. Increase this to get better index handling (for all reads and multiple writes) to as much as you can afford', '0', '18446744073709551615', '4096', NULL, 'NO', 'REQUIRED'),
('PID_FILE', NULL, '/var/run/mysqld/mysqld.pid', 'CONFIG', '', 'GLOBAL', 'VARCHAR', 'Pid file used by safe_mysqld', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED'),
('INNODB_USE_FALLOCATE', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Use posix_fallocate() to allocate files. DEPRECATED, has no effect.', NULL, NULL, NULL, 'OFF,ON', 'YES', 'NONE'),
('READ_BUFFER_SIZE', '131072', '131072', 'COMPILE-TIME', '131072', 'SESSION', 'BIGINT UNSIGNED', 'Each thread that does a sequential scan allocates a buffer of this size for each table it scans. If you do many sequential scans, you may want to increase this value', '8192', '2147483647', '4096', NULL, 'NO', 'REQUIRED'),
('PSEUDO_SLAVE_MODE', 'OFF', NULL, 'COMPILE-TIME', 'OFF', 'SESSION ONLY', 'BOOLEAN', 'SET pseudo_slave_mode= 0,1 are commands that mysqlbinlog adds to beginning and end of binary log dumps. While zero value indeed disables, the actual enabling of the slave applier execution mode is done implicitly when a Format_description_event is sent through the session.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL),
('MIN_EXAMINED_ROW_LIMIT', '0', '0', 'COMPILE-TIME', '0', 'SESSION', 'BIGINT UNSIGNED', 'Don''t write queries to slow log that examine fewer rows than that', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED'),
('SYNC_RELAY_LOG', NULL, '10000', 'COMPILE-TIME', '10000', 'GLOBAL', 'INT UNSIGNED', 'Synchronously flush relay log to disk after every #th event. Use 0 to disable synchronous flushing', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED'),
('TMPDIR', NULL, '/tmp', 'CONFIG', '', 'GLOBAL', 'VARCHAR', 'Path for temporary files. Several paths may be specified, separated by a colon (:), in this case they are used in a round-robin fashion', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED'),
('INNODB_DEFAULT_ENCRYPTION_KEY_ID', '1', '1', 'COMPILE-TIME', '1', 'SESSION', 'INT UNSIGNED', 'Default encryption key id used for table encryption.', '1', '4294967295', '0', NULL, 'NO', 'REQUIRED'),
('HOSTNAME', NULL, 'LEOANA07', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'Server host name', NULL, NULL, NULL, NULL, 'YES', NULL),
('INNODB_MAX_UNDO_LOG_SIZE', NULL, '10485760', 'COMPILE-TIME', '10485760', 'GLOBAL', 'BIGINT UNSIGNED', 'Desired maximum UNDO tablespace size in bytes', '10485760', '281474976710656', '0', NULL, 'NO', 'OPTIONAL'),
('SYSTEM_TIME_ZONE', NULL, '-03', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'The server system time zone', NULL, NULL, NULL, NULL, 'YES', NULL),
('SKIP_EXTERNAL_LOCKING', NULL, 'ON', 'COMPILE-TIME', NULL, 'GLOBAL', 'BOOLEAN', 'Don''t use system (external) locking', NULL, NULL, NULL, 'OFF,ON', 'YES', NULL),
('THREAD_POOL_MAX_THREADS', NULL, '65536', 'COMPILE-TIME', '65536', 'GLOBAL', 'INT UNSIGNED', 'Maximum allowed number of worker threads in the thread pool', '1', '65536', '1', NULL, 'NO', 'REQUIRED'),
('SLAVE_NET_TIMEOUT', NULL, '60', 'COMPILE-TIME', '60', 'GLOBAL', 'INT UNSIGNED', 'Number of seconds to wait for more data from any master/slave connection before aborting the read', '1', '31536000', '1', NULL, 'NO', 'REQUIRED'),
('BINLOG_DIRECT_NON_TRANSACTIONAL_UPDATES', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'Causes updates to non-transactional engines using statement format to be written directly to binary log. Before using this option make sure that there are no dependencies between transactional and non-transactional tables such as in the statement INSERT INTO t_myisam SELECT * FROM t_innodb; otherwise, slaves may diverge from the master.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('INNODB_STATS_SAMPLE_PAGES', NULL, '8', 'COMPILE-TIME', '8', 'GLOBAL', 'BIGINT UNSIGNED', 'Deprecated, use innodb_stats_transient_sample_pages instead', '1', '18446744073709551615', '0', NULL, 'NO', 'REQUIRED'),
('PERFORMANCE_SCHEMA_MAX_FILE_INSTANCES', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'BIGINT', 'Maximum number of instrumented files. Use 0 to disable, -1 for automated sizing.', '-1', '1048576', '1', NULL, 'YES', 'REQUIRED'),
('THREAD_POOL_PRIORITY', 'auto', 'auto', 'COMPILE-TIME', 'auto', 'SESSION', 'ENUM', 'Threadpool priority. High priority connections usually start executing earlier than low priority.If priority set to ''auto'', the the actual priority(low or high) is determined based on whether or not connection is inside transaction.', NULL, NULL, NULL, 'high,low,auto', 'NO', 'REQUIRED'),
('SSL_CAPATH', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'CA directory (check OpenSSL docs, implies --ssl)', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED'),
('INTERACTIVE_TIMEOUT', '28800', '28800', 'COMPILE-TIME', '28800', 'SESSION', 'BIGINT UNSIGNED', 'The number of seconds the server waits for activity on an interactive connection before closing it', '1', '31536000', '1', NULL, 'NO', 'REQUIRED'),
('VERSION_COMMENT', NULL, 'mariadb.org binary distribution', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'Value of the COMPILATION_COMMENT option specified by CMake when building MariaDB, for example mariadb.org binary distribution.', NULL, NULL, NULL, NULL, 'YES', NULL),
('INNODB_ADAPTIVE_FLUSHING_LWM', NULL, '10.000000', 'COMPILE-TIME', '10.000000', 'GLOBAL', 'DOUBLE', 'Percentage of log capacity below which no adaptive flushing happens.', '0', '70', NULL, NULL, 'NO', 'REQUIRED'),
('PERFORMANCE_SCHEMA_HOSTS_SIZE', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'BIGINT', 'Maximum number of instrumented hosts. Use 0 to disable, -1 for automated sizing.', '-1', '1048576', '1', NULL, 'YES', 'REQUIRED'),
('INNODB_DEFRAGMENT_FREQUENCY', NULL, '40', 'COMPILE-TIME', '40', 'GLOBAL', 'INT UNSIGNED', 'Do not defragment a single index more than this number of time per second.This controls the number of time defragmentation thread can request X_LOCK on an index. Defragmentation thread will check whether 1/defragment_frequency (s) has passed since it worked on this index last time, and put the index back to the queue if not enough time has passed. The actual frequency can only be lower than this given number.', '1', '1000', '0', NULL, 'NO', 'REQUIRED'),
('MAX_USER_CONNECTIONS', '0', '0', 'COMPILE-TIME', '0', 'SESSION', 'INT', 'The maximum number of active connections for a single user (0 = no limit)', '-1', '2147483647', '1', NULL, 'NO', 'REQUIRED'),
('SQL_WARNINGS', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'If set to 1, single-row INSERTs will produce a string containing warning information if a warning occurs.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL),
('BINLOG_COMMIT_WAIT_COUNT', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT UNSIGNED', 'If non-zero, binlog write will wait at most binlog_commit_wait_usec microseconds for at least this many commits to queue up for group commit to the binlog. This can reduce I/O on the binlog and provide increased opportunity for parallel apply on the slave, but too high a value will decrease commit throughput.', '0', '18446744073709551615', '1', NULL, 'NO', 'REQUIRED'),
('STRICT_PASSWORD_VALIDATION', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'When password validation plugins are enabled, reject passwords that cannot be validated (passwords specified as a hash)', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('DEFAULT_MASTER_CONNECTION', '', NULL, 'COMPILE-TIME', '', 'SESSION ONLY', 'VARCHAR', 'Master connection to use for all slave variables and slave commands', NULL, NULL, NULL, NULL, 'NO', NULL),
('INNODB_SCHED_PRIORITY_CLEANER', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT UNSIGNED', 'Deprecated and ignored; only exists to allow easier upgrade from earlier XtraDB versions.', '0', '39', '0', NULL, 'NO', 'REQUIRED'),
('MYISAM_MMAP_SIZE', NULL, '18446744073709551615', 'COMPILE-TIME', '18446744073709551615', 'GLOBAL', 'BIGINT UNSIGNED', 'Restricts the total memory used for memory mapping of MySQL tables', '7', '18446744073709551615', '1', NULL, 'YES', 'REQUIRED'),
