('MAX_SORT_LENGTH', '1024', '1024', 'COMPILE-TIME', '1024', 'SESSION', 'BIGINT UNSIGNED', 'The number of bytes to use when sorting BLOB or TEXT values (only the first max_sort_length bytes of each value are used; the rest are ignored)', '4', '8388608', '1', NULL, 'NO', 'REQUIRED'),
('THREAD_POOL_STALL_LIMIT', NULL, '500', 'COMPILE-TIME', '500', 'GLOBAL', 'INT UNSIGNED', 'Maximum query execution time in milliseconds,before an executing non-yielding thread is considered stalled.If a worker thread is stalled, additional worker thread may be created to handle remaining clients.', '10', '4294967295', '1', NULL, 'NO', 'REQUIRED'),
