('TX_READ_ONLY', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'Default transaction access mode. If set to OFF, the default, access is read/write. If set to ON, access is read-only. The SET TRANSACTION statement can also change the value of this variable. See SET TRANSACTION and START TRANSACTION.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL),
('PERFORMANCE_SCHEMA_MAX_SOCKET_CLASSES', NULL, '10', 'COMPILE-TIME', '10', 'GLOBAL', 'BIGINT UNSIGNED', 'Maximum number of socket instruments.', '0', '256', '1', NULL, 'YES', 'REQUIRED'),
