('GTID_CURRENT_POS', NULL, '', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'Current GTID position of the server. Per replication domain, this is either the last GTID replicated by a slave thread, or the GTID logged to the binary log, whichever is most recent.', NULL, NULL, NULL, NULL, 'YES', NULL),
