('PORT', NULL, '3306', 'CONFIG', '0', 'GLOBAL', 'INT UNSIGNED', 'Port number to use for connection or 0 to default to, my.cnf, $MYSQL_TCP_PORT, /etc/services, built-in default (3306), whatever comes first', '0', '4294967295', '1', NULL, 'YES', 'REQUIRED'),
('VERSION_COMPILE_MACHINE', NULL, 'x86_64', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'The machine type or architecture MariaDB was built on, for example i686.', NULL, NULL, NULL, NULL, 'YES', NULL),
