('CHECK_CONSTRAINT_CHECKS', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'check_constraint_checks', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL),
('LOG_BIN_TRUST_FUNCTION_CREATORS', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'If set to FALSE (the default), then when --log-bin is used, creation of a stored function (or trigger) is allowed only to users having the SUPER privilege and only if this stored function (trigger) may not break binary logging. Note that if ALL connections to this server ALWAYS use row-based binary logging, the security issues do not exist and the binary logging cannot break, so you can safely set this to TRUE', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('TABLE_DEFINITION_CACHE', NULL, '400', 'AUTO', '400', 'GLOBAL', 'BIGINT UNSIGNED', 'The number of cached table definitions', '400', '524288', '1', NULL, 'NO', 'REQUIRED'),
('INNODB_MAX_CHANGED_PAGES', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT UNSIGNED', 'Deprecated and ignored; only exists to allow easier upgrade from earlier XtraDB versions.', '0', '18446744073709551615', '0', NULL, 'NO', 'REQUIRED'),
('QUERY_ALLOC_BLOCK_SIZE', '16384', '16384', 'COMPILE-TIME', '16384', 'SESSION', 'BIGINT UNSIGNED', 'Allocation block size for query parsing and execution', '1024', '4294967295', '1024', NULL, 'NO', 'REQUIRED'),
('MYISAM_BLOCK_SIZE', NULL, '1024', 'COMPILE-TIME', '1024', 'GLOBAL', 'BIGINT UNSIGNED', 'Block size to be used for MyISAM index pages', '1024', '16384', '1024', NULL, 'YES', 'REQUIRED'),
('METADATA_LOCKS_CACHE_SIZE', NULL, '1024', 'COMPILE-TIME', '1024', 'GLOBAL', 'BIGINT UNSIGNED', 'Unused', '1', '1048576', '1', NULL, 'YES', 'REQUIRED'),
('MAX_BINLOG_STMT_CACHE_SIZE', NULL, '18446744073709547520', 'COMPILE-TIME', '18446744073709547520', 'GLOBAL', 'BIGINT UNSIGNED', 'Sets the total size of the statement cache', '4096', '18446744073709551615', '4096', NULL, 'NO', 'REQUIRED'),
('TMP_TABLE_SIZE', '16777216', '16777216', 'COMPILE-TIME', '16777216', 'SESSION', 'BIGINT UNSIGNED', 'Alias for tmp_memory_table_size. If an internal in-memory temporary table exceeds this size, MariaDB will automatically convert it to an on-disk MyISAM or Aria table.', '1024', '18446744073709551615', '1', NULL, 'NO', 'REQUIRED'),
('INNODB_BUFFER_POOL_POPULATE', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Deprecated and ignored; only exists to allow easier upgrade from earlier XtraDB versions.', NULL, NULL, NULL, 'OFF,ON', 'YES', 'NONE'),
('THREAD_HANDLING', NULL, 'one-thread-per-connection', 'COMPILE-TIME', 'one-thread-per-connection', 'GLOBAL', 'ENUM', 'Define threads usage for handling queries', NULL, NULL, NULL, 'one-thread-per-connection,no-threads,pool-of-threads', 'YES', 'REQUIRED'),
('INNODB_SPIN_WAIT_DELAY', NULL, '6', 'COMPILE-TIME', '6', 'GLOBAL', 'INT UNSIGNED', 'Maximum delay between polling for a spin lock (6 by default)', '0', '6000', '0', NULL, 'NO', 'OPTIONAL'),
('QUERY_CACHE_TYPE', 'ON', 'ON', 'COMPILE-TIME', 'OFF', 'SESSION', 'ENUM', 'OFF = Don''t cache or retrieve results. ON = Cache all results except SELECT SQL_NO_CACHE ... queries. DEMAND = Cache only SELECT SQL_CACHE ... queries', NULL, NULL, NULL, 'OFF,ON,DEMAND', 'NO', 'REQUIRED'),
('INNODB_ADAPTIVE_HASH_INDEX_PARTITIONS', NULL, '8', 'COMPILE-TIME', '8', 'GLOBAL', 'BIGINT UNSIGNED', 'It is an alias for innodb_adaptive_hash_index_parts; only exists to allow easier upgrade from earlier XtraDB versions.', '1', '512', '0', NULL, 'YES', 'OPTIONAL'),
('VERSION_MALLOC_LIBRARY', NULL, 'system', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'Version of the used malloc library', NULL, NULL, NULL, NULL, 'YES', NULL),
('INNODB_DEFRAGMENT_STATS_ACCURACY', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'How many defragment stats changes there are before the stats are written to persistent storage. Set to 0 meaning disable defragment stats tracking.', '0', '4294967295', '0', NULL, 'NO', 'REQUIRED'),
('GTID_SLAVE_POS', NULL, '', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'The list of global transaction IDs that were last replicated on the server, one for each replication domain.', NULL, NULL, NULL, NULL, 'NO', NULL),
('INNODB_LOCK_WAIT_TIMEOUT', '50', '50', 'COMPILE-TIME', '50', 'SESSION', 'BIGINT UNSIGNED', 'Timeout in seconds an InnoDB transaction may wait for a lock before being rolled back. Values above 100000000 disable the timeout.', '1', '1073741824', '0', NULL, 'NO', 'REQUIRED'),
('MAX_SP_RECURSION_DEPTH', '0', '0', 'COMPILE-TIME', '0', 'SESSION', 'BIGINT UNSIGNED', 'Maximum stored procedure recursion depth', '0', '255', '1', NULL, 'NO', 'OPTIONAL'),
('INNODB_OLD_BLOCKS_TIME', NULL, '1000', 'COMPILE-TIME', '1000', 'GLOBAL', 'INT UNSIGNED', 'Move blocks to the ''new'' end of the buffer pool if the first access was at least this many milliseconds ago. The timeout is disabled if 0.', '0', '4294967295', '0', NULL, 'NO', 'REQUIRED'),
('REPORT_PORT', NULL, '3306', 'AUTO', '0', 'GLOBAL', 'INT UNSIGNED', 'Port for connecting to slave reported to the master during slave registration. Set it only if the slave is listening on a non-default port or if you have a special tunnel from the master or other clients to the slave. If not sure, leave this option unset', '0', '4294967295', '1', NULL, 'YES', 'REQUIRED'),
('SQL_LOG_BIN', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'If set to 0 (1 is the default), no logging to the binary log is done for the client. Only clients with the SUPER privilege can update this variable. Can have unintended consequences if set globally, see SET SQL_LOG_BIN. Starting MariaDB 10.1.7, this variable does not affect the replication of events in a Galera cluster.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL),
('SLOW_QUERY_LOG_FILE', NULL, 'LEOANA07-slow.log', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Log slow queries to given log file. Defaults logging to ''hostname''-slow.log. Must be enabled to activate other slow log options', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED'),
('CHARACTER_SET_SYSTEM', NULL, 'utf8', 'COMPILE-TIME', NULL, 'GLOBAL', 'ENUM', 'The character set used by the server for storing identifiers', NULL, NULL, NULL, NULL, 'YES', NULL),
('EXPIRE_LOGS_DAYS', NULL, '10', 'CONFIG', '0', 'GLOBAL', 'BIGINT UNSIGNED', 'If non-zero, binary logs will be purged after expire_logs_days days; possible purges happen at startup and at binary log rotation', '0', '99', '1', NULL, 'NO', 'REQUIRED'),
('INNODB_COMPRESSION_FAILURE_THRESHOLD_PCT', NULL, '5', 'COMPILE-TIME', '5', 'GLOBAL', 'BIGINT UNSIGNED', 'If the compression failure rate of a table is greater than this number more padding is added to the pages to reduce the failures. A value of zero implies no padding', '0', '100', '0', NULL, 'NO', 'OPTIONAL'),
('SLAVE_EXEC_MODE', NULL, 'STRICT', 'COMPILE-TIME', 'STRICT', 'GLOBAL', 'ENUM', 'How replication events should be executed. Legal values are STRICT (default) and IDEMPOTENT. In IDEMPOTENT mode, replication will not stop for operations that are idempotent. For example, in row based replication attempts to delete rows that doesn''t exist will be ignored. In STRICT mode, replication will stop on any unexpected difference between the master and the slave.', NULL, NULL, NULL, 'STRICT,IDEMPOTENT', 'NO', 'REQUIRED'),
