('REPLICATE_IGNORE_DB', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Tell the slave to restrict replication to updates of tables whose names do not appear in the comma-separated list. For statement-based replication, only the default database (that is, the one selected by USE) is considered, not any explicitly mentioned tables in the query. For row-based replication, the actual names of table(s) being updated are checked.', NULL, NULL, NULL, NULL, 'NO', NULL),
('REPLICATE_DO_DB', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Tell the slave to restrict replication to updates of tables whose names appear in the comma-separated list. For statement-based replication, only the default database (that is, the one selected by USE) is considered, not any explicitly mentioned tables in the query. For row-based replication, the actual names of table(s) being updated are checked.', NULL, NULL, NULL, NULL, 'NO', NULL),
('INNODB_COMPRESSION_ALGORITHM', NULL, 'zlib', 'COMPILE-TIME', 'zlib', 'GLOBAL', 'ENUM', 'Compression algorithm used on page compression. One of: none, zlib, lz4, lzo, lzma, or bzip2', NULL, NULL, NULL, 'none,zlib,lz4,lzo,lzma,bzip2,snappy', 'NO', 'OPTIONAL'),
('WSREP_NODE_NAME', NULL, 'LEOANA07', 'COMPILE-TIME', 'LEOANA07', 'GLOBAL', 'VARCHAR', 'Name of this node. This name can be used in wsrep_sst_donor as a preferred donor. Note that multiple nodes in a cluster can have the same name.', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED'),
('PLUGIN_MATURITY', NULL, 'unknown', 'COMPILE-TIME', 'unknown', 'GLOBAL', 'ENUM', 'The lowest desirable plugin maturity. Plugins less mature than that will not be installed or loaded', NULL, NULL, NULL, 'unknown,experimental,alpha,beta,gamma,stable', 'YES', 'REQUIRED'),
('HAVE_RTREE_KEYS', NULL, 'YES', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'If RTREE indexes (used for spatial indexes) are available, will be set to YES, otherwise will be set to NO.', NULL, NULL, NULL, NULL, 'YES', NULL),
('INNODB_PURGE_THREADS', NULL, '4', 'COMPILE-TIME', '4', 'GLOBAL', 'BIGINT UNSIGNED', 'Purge threads can be from 1 to 32. Default is 4.', '1', '32', '0', NULL, 'YES', 'OPTIONAL'),
('BIG_TABLES', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'Old variable, which if set to 1, allows large result sets by saving all temporary sets to disk, avoiding ''table full'' errors. No longer needed, as the server now handles this automatically. sql_big_tables is a synonym.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('PROFILING', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'If set to 1 (0 is default), statement profiling will be enabled. See SHOW PROFILES and SHOW PROFILE.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL),
('MASTER_VERIFY_CHECKSUM', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Force checksum verification of logged events in the binary log before sending them to slaves or printing them in the output of SHOW BINLOG EVENTS', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('ARIA_PAGECACHE_BUFFER_SIZE', NULL, '134217728', 'COMPILE-TIME', '134217728', 'GLOBAL', 'BIGINT UNSIGNED', 'The size of the buffer used for index blocks for Aria tables. Increase this to get better index handling (for all reads and multiple writes) to as much as you can afford.', '131072', '18446744073709551615', '1', NULL, 'YES', 'REQUIRED'),
('INNODB_VERSION', NULL, '5.7.21', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'InnoDB version', NULL, NULL, NULL, NULL, 'YES', NULL),
('EXPENSIVE_SUBQUERY_LIMIT', '100', '100', 'COMPILE-TIME', '100', 'SESSION', 'BIGINT UNSIGNED', 'The maximum number of rows a subquery may examine in order to be executed during optimization and used for constant optimization', '0', '18446744073709551615', '1', NULL, 'NO', 'REQUIRED'),
('MAX_JOIN_SIZE', '18446744073709551615', '18446744073709551615', 'COMPILE-TIME', '18446744073709551615', 'SESSION', 'BIGINT UNSIGNED', 'Joins that are probably going to read more than max_join_size records return an error', '1', '18446744073709551615', '1', NULL, 'NO', 'REQUIRED');
