('KEY_CACHE_AGE_THRESHOLD', NULL, '300', 'COMPILE-TIME', '300', 'GLOBAL', 'BIGINT UNSIGNED', 'This characterizes the number of hits a hot block has to be untouched until it is considered aged enough to be downgraded to a warm block. This specifies the percentage ratio of that number of hits to the total number of blocks in key cache', '100', '4294967295', '100', NULL, 'NO', 'REQUIRED'),
('GTID_DOMAIN_ID', '0', '0', 'COMPILE-TIME', '0', 'SESSION', 'INT UNSIGNED', 'Used with global transaction ID to identify logically independent replication streams. When events can propagate through multiple parallel paths (for example multiple masters), each independent source server must use a distinct domain_id. For simple tree-shaped replication topologies, it can be left at its default, 0.', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED'),
('FOREIGN_KEY_CHECKS', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'If set to 1 (the default) foreign key constraints (including ON UPDATE and ON DELETE behavior) InnoDB tables are checked, while if set to 0, they are not checked. 0 is not recommended for normal use, though it can be useful in situations where you know the data is consistent, but want to reload data in a different order from that that specified by parent/child relationships. Setting this variable to 1 does not retrospectively check for inconsistencies introduced while set to 0.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL),
('HAVE_QUERY_CACHE', NULL, 'YES', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'If the server supports the query cache, will be set to YES, otherwise will be set to NO.', NULL, NULL, NULL, NULL, 'YES', NULL),
('INNODB_KILL_IDLE_TRANSACTION', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT', 'No effect for this build.', '0', '9223372036854775807', '0', NULL, 'NO', 'REQUIRED'),
