('SESSION_TRACK_TRANSACTION_INFO', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'ENUM', 'Track changes to the transaction attributes. OFF to disable; STATE to track just transaction state (Is there an active transaction? Does it have any data? etc.); CHARACTERISTICS to track transaction state and report all statements needed to start a transaction withthe same characteristics (isolation level, read only/read write,snapshot - but not any work done / data modified within the transaction).', NULL, NULL, NULL, 'OFF,STATE,CHARACTERISTICS', 'NO', 'REQUIRED'),
