('MYSQL56_TEMPORAL_FORMAT', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Use MySQL-5.6 (instead of MariaDB-5.3) format for TIME, DATETIME, TIMESTAMP columns.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('VERSION_COMPILE_OS', NULL, 'debian-linux-gnu', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'Operating system that MariaDB was built on, for example debian-linux-gnu.', NULL, NULL, NULL, NULL, 'YES', NULL),
('GTID_BINLOG_STATE', NULL, '', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'The internal GTID state of the binlog, used to keep track of all GTIDs ever logged to the binlog.', NULL, NULL, NULL, NULL, 'NO', NULL),
('INNODB_CHECKSUM_ALGORITHM', NULL, 'crc32', 'COMPILE-TIME', 'crc32', 'GLOBAL', 'ENUM', 'The algorithm InnoDB uses for page checksumming. Possible values are CRC32 (hardware accelerated if the CPU supports it) write crc32, allow any of the other checksums to match when reading; STRICT_CRC32 write crc32, do not allow other algorithms to match when reading; INNODB write a software calculated checksum, allow any other checksums to match when reading; STRICT_INNODB write a software calculated checksum, do not allow other algorithms to match when reading; NONE write a constant magic number, do not do any checksum verification when reading (same as innodb_checksums=OFF); STRICT_NONE write a constant magic number, do not allow values other than that magic number when reading; Files updated when this option is set to crc32 or strict_crc32 will not be readable by MariaDB versions older than 10.0.4', NULL, NULL, NULL, 'crc32,strict_crc32,innodb,strict_innodb,none,strict_none', 'NO', 'REQUIRED'),
('INNODB_SYNC_ARRAY_SIZE', NULL, '1', 'COMPILE-TIME', '1', 'GLOBAL', 'BIGINT UNSIGNED', 'Size of the mutex/lock wait array.', '1', '1024', '0', NULL, 'YES', 'OPTIONAL'),
('DEADLOCK_TIMEOUT_SHORT', '10000', '10000', 'COMPILE-TIME', '10000', 'SESSION', 'BIGINT UNSIGNED', 'Short timeout for the two-step deadlock detection (in microseconds)', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED'),
('INNODB_OPEN_FILES', NULL, '2000', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT', 'How many files at the maximum InnoDB keeps open at the same time.', '0', '9223372036854775807', '0', NULL, 'YES', 'REQUIRED'),
('WSREP_CLUSTER_NAME', NULL, 'my_wsrep_cluster', 'COMPILE-TIME', 'my_wsrep_cluster', 'GLOBAL', 'VARCHAR', 'Name for the cluster', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED'),
('WSREP_DESYNC', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'To desynchronize the node from the cluster', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('ARIA_GROUP_COMMIT', NULL, 'none', 'COMPILE-TIME', 'none', 'GLOBAL', 'ENUM', 'Specifies Aria group commit mode. Possible values are "none" (no group commit), "hard" (with waiting to actual commit), "soft" (no wait for commit (DANGEROUS!!!))', NULL, NULL, NULL, 'none,hard,soft', 'NO', 'REQUIRED'),
('INIT_SLAVE', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Command(s) that are executed by a slave server each time the SQL thread starts', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED'),
('INNODB_LOG_FILE_SIZE', NULL, '50331648', 'COMPILE-TIME', '50331648', 'GLOBAL', 'BIGINT UNSIGNED', 'Size of each log file in a log group.', '1048576', '549755813888', '65536', NULL, 'YES', 'REQUIRED'),
('REPLICATE_EVENTS_MARKED_FOR_SKIP', NULL, 'REPLICATE', 'COMPILE-TIME', 'REPLICATE', 'GLOBAL', 'ENUM', 'Whether the slave should replicate events that were created with @@skip_replication=1 on the master. Default REPLICATE (no events are skipped). Other values are FILTER_ON_SLAVE (events will be sent by the master but ignored by the slave) and FILTER_ON_MASTER (events marked with @@skip_replication=1 will be filtered on the master and never be sent to the slave).', NULL, NULL, NULL, 'REPLICATE,FILTER_ON_SLAVE,FILTER_ON_MASTER', 'NO', 'REQUIRED'),
('TIME_ZONE', '+00:00', 'SYSTEM', 'COMPILE-TIME', 'SYSTEM', 'SESSION', 'VARCHAR', 'The current time zone, used to initialize the time zone for a client when it connects. Set to SYSTEM by default, in which the client uses the system time zone value.', NULL, NULL, NULL, NULL, 'NO', NULL),
('RELAY_LOG_RECOVERY', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enables automatic relay log recovery right after the database startup, which means that the IO Thread starts re-fetching from the master right after the last transaction processed.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('USERSTAT', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enables statistics gathering for USER_STATISTICS, CLIENT_STATISTICS, INDEX_STATISTICS and TABLE_STATISTICS tables in the INFORMATION_SCHEMA', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('WSREP_OSU_METHOD', 'TOI', 'TOI', 'COMPILE-TIME', 'TOI', 'SESSION', 'ENUM', 'Method for Online Schema Upgrade', NULL, NULL, NULL, 'TOI,RSU', 'NO', 'OPTIONAL'),
('SESSION_TRACK_SYSTEM_VARIABLES', '', '', 'COMPILE-TIME', '', 'SESSION', 'VARCHAR', 'Track changes in registered system variables. For compatibility with MySQL defaults this variable should be set to "autocommit, character_set_client, character_set_connection, character_set_results, time_zone"', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED'),
('INNODB_TABLE_LOCKS', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'Enable InnoDB locking in LOCK TABLES', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('INNODB_PURGE_BATCH_SIZE', NULL, '300', 'COMPILE-TIME', '300', 'GLOBAL', 'BIGINT UNSIGNED', 'Number of UNDO log pages to purge in one batch from the history list.', '1', '5000', '0', NULL, 'NO', 'OPTIONAL'),
('WSREP_SST_RECEIVE_ADDRESS', NULL, 'AUTO', 'COMPILE-TIME', 'AUTO', 'GLOBAL', 'VARCHAR', 'Address where node is waiting for SST contact', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED'),
('INNODB_FORCE_PRIMARY_KEY', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Do not allow to create table without primary key (off by default)', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('INNODB_LOG_ARCH_DIR', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Deprecated and ignored; only exists to allow easier upgrade from earlier XtraDB versions.', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED'),
('QUERY_CACHE_LIMIT', NULL, '1048576', 'CONFIG', '1048576', 'GLOBAL', 'BIGINT UNSIGNED', 'Don''t cache results that are bigger than this', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED'),
('SLAVE_DOMAIN_PARALLEL_THREADS', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT UNSIGNED', 'Maximum number of parallel threads to use on slave for events in a single replication domain. When using multiple domains, this can be used to limit a single domain from grabbing all threads and thus stalling other domains. The default of 0 means to allow a domain to grab as many threads as it wants, up to the value of slave_parallel_threads.', '0', '16383', '1', NULL, 'NO', 'REQUIRED'),
('RELAY_LOG_PURGE', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'if disabled - do not purge relay logs. if enabled - purge them as soon as they are no more needed.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('ENFORCE_STORAGE_ENGINE', '', '', 'COMPILE-TIME', NULL, 'SESSION', 'VARCHAR', 'Force the use of a storage engine for new tables', NULL, NULL, NULL, NULL, 'NO', NULL),
('INNODB_FT_TOTAL_CACHE_SIZE', NULL, '640000000', 'COMPILE-TIME', '640000000', 'GLOBAL', 'BIGINT UNSIGNED', 'Total memory allocated for InnoDB Fulltext Search cache', '32000000', '1600000000', '0', NULL, 'YES', 'REQUIRED');
INSERT INTO `SYSTEM_VARIABLES` (`VARIABLE_NAME`, `SESSION_VALUE`, `GLOBAL_VALUE`, `GLOBAL_VALUE_ORIGIN`, `DEFAULT_VALUE`, `VARIABLE_SCOPE`, `VARIABLE_TYPE`, `VARIABLE_COMMENT`, `NUMERIC_MIN_VALUE`, `NUMERIC_MAX_VALUE`, `NUMERIC_BLOCK_SIZE`, `ENUM_VALUE_LIST`, `READ_ONLY`, `COMMAND_LINE_ARGUMENT`) VALUES
('INNODB_FT_ENABLE_DIAG_PRINT', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Whether to enable additional FTS diagnostic printout ', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('ARIA_PAGE_CHECKSUM', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Maintain page checksums (can be overridden per table with PAGE_CHECKSUM clause in CREATE TABLE)', NULL, NULL, NULL, 'OFF,ON', 'NO', 'REQUIRED'),
('HAVE_SYMLINK', NULL, 'YES', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'If symbolic link support is enabled, will be set to YES, otherwise will be set to NO. Required for the INDEX DIRECTORY and DATA DIRECTORY table options (see CREATE TABLE) and Windows symlink support. Will be set to DISABLED if the server is started with the --skip-symbolic-links option.', NULL, NULL, NULL, NULL, 'YES', NULL),
('SESSION_TRACK_SCHEMA', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'Track changes to the default schema.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('INNODB_FAST_SHUTDOWN', NULL, '1', 'COMPILE-TIME', '1', 'GLOBAL', 'INT UNSIGNED', 'Speeds up the shutdown process of the InnoDB storage engine. Possible values are 0, 1 (faster) or 2 (fastest - crash-like).', '0', '2', '0', NULL, 'NO', 'OPTIONAL'),
('OPTIMIZER_SELECTIVITY_SAMPLING_LIMIT', '100', '100', 'COMPILE-TIME', '100', 'SESSION', 'BIGINT UNSIGNED', 'Controls number of record samples to check condition selectivity', '10', '4294967295', '1', NULL, 'NO', 'REQUIRED'),
('INNODB_FLUSH_NEIGHBORS', NULL, '1', 'COMPILE-TIME', '1', 'GLOBAL', 'BIGINT UNSIGNED', 'Set to 0 (don''t flush neighbors from buffer pool), 1 (flush contiguous neighbors from buffer pool) or 2 (flush neighbors from buffer pool), when flushing a block', '0', '2', '0', NULL, 'NO', 'OPTIONAL'),
('BACK_LOG', NULL, '80', 'AUTO', '150', 'GLOBAL', 'BIGINT UNSIGNED', 'The number of outstanding connection requests MariaDB can have. This comes into play when the main MariaDB thread gets very many connection requests in a very short time', '0', '65535', '1', NULL, 'YES', 'REQUIRED'),
('INNODB_SYNC_SPIN_LOOPS', NULL, '30', 'COMPILE-TIME', '30', 'GLOBAL', 'BIGINT UNSIGNED', 'Count of spin-loop rounds in InnoDB mutexes (30 by default)', '0', '18446744073709551615', '0', NULL, 'NO', 'REQUIRED'),
('INNODB_STATS_PERSISTENT_SAMPLE_PAGES', NULL, '20', 'COMPILE-TIME', '20', 'GLOBAL', 'BIGINT UNSIGNED', 'The number of leaf index pages to sample when calculating persistent statistics (by ANALYZE, default 20)', '1', '18446744073709551615', '0', NULL, 'NO', 'REQUIRED'),
('INNODB_SCRUB_LOG', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enable background redo log (ib_logfile0, ib_logfile1...) scrubbing', NULL, NULL, NULL, 'OFF,ON', 'YES', 'OPTIONAL'),
('RAND_SEED2', '404409152', NULL, 'COMPILE-TIME', '0', 'SESSION ONLY', 'BIGINT UNSIGNED', 'Sets the internal state of the RAND() generator for replication purposes', '0', '18446744073709551615', '1', NULL, 'NO', NULL),
('INNODB_THREAD_SLEEP_DELAY', NULL, '10000', 'COMPILE-TIME', '10000', 'GLOBAL', 'BIGINT UNSIGNED', 'Time of innodb thread sleeping before joining InnoDB queue (usec). Value 0 disable a sleep', '0', '1000000', '0', NULL, 'NO', 'REQUIRED'),
('ENCRYPT_TMP_FILES', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Encrypt temporary files (created for filesort, binary log cache, etc)', NULL, NULL, NULL, 'OFF,ON', 'YES', 'OPTIONAL'),
('WSREP_RECOVER', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Recover database state after crash and exit', NULL, NULL, NULL, 'OFF,ON', 'YES', 'OPTIONAL'),
('ARIA_STATS_METHOD', 'nulls_unequal', 'nulls_unequal', 'COMPILE-TIME', 'nulls_unequal', 'SESSION', 'ENUM', 'Specifies how Aria index statistics collection code should treat NULLs', NULL, NULL, NULL, 'nulls_unequal,nulls_equal,nulls_ignored', 'NO', 'REQUIRED'),
('INNODB_BUF_DUMP_STATUS_FREQUENCY', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT UNSIGNED', 'A number between [0, 100] that tells how oftern buffer pool dump status in percentages should be printed. E.g. 10 means that buffer pool dump status is printed when every 10% of number of buffer pool pages are dumped. Default is 0 (only start and end status is printed).', '0', '100', '0', NULL, 'NO', 'REQUIRED'),
('INNODB_MONITOR_ENABLE', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Turn on a monitor counter', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED'),
('WSREP_GTID_DOMAIN_ID', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'When wsrep_gtid_mode is set, this value is used as gtid_domain_id for galera transactions and also copied to the joiner nodes during state transfer. It is ignored, otherwise.', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED'),
('INNODB_MONITOR_RESET', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Reset a monitor counter', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED'),
('MAX_SEEKS_FOR_KEY', '4294967295', '4294967295', 'COMPILE-TIME', '4294967295', 'SESSION', 'BIGINT UNSIGNED', 'Limit assumed max number of seeks when looking up rows based on a key', '1', '4294967295', '1', NULL, 'NO', 'REQUIRED'),
('HISTOGRAM_SIZE', '0', '0', 'COMPILE-TIME', '0', 'SESSION', 'BIGINT UNSIGNED', 'Number of bytes used for a histogram. If set to 0, no histograms are created by ANALYZE.', '0', '255', '1', NULL, 'NO', 'REQUIRED'),
('INNODB_REPLICATION_DELAY', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT UNSIGNED', 'Replication thread delay (ms) on the slave server if innodb_thread_concurrency is reached (0 by default)', '0', '18446744073709551615', '0', NULL, 'NO', 'REQUIRED'),
('INNODB_LRU_SCAN_DEPTH', NULL, '1024', 'COMPILE-TIME', '1024', 'GLOBAL', 'BIGINT UNSIGNED', 'How deep to scan LRU to keep it clean', '100', '18446744073709551615', '0', NULL, 'NO', 'REQUIRED'),
('QUERY_CACHE_MIN_RES_UNIT', NULL, '4096', 'COMPILE-TIME', '4096', 'GLOBAL', 'BIGINT UNSIGNED', 'The minimum size for blocks allocated by the query cache', '0', '4294967295', '8', NULL, 'NO', 'REQUIRED'),
('INNODB_UNDO_TABLESPACES', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT UNSIGNED', 'Number of undo tablespaces to use.', '0', '127', '0', NULL, 'YES', 'REQUIRED'),
('INNODB_WRITE_IO_THREADS', NULL, '4', 'COMPILE-TIME', '4', 'GLOBAL', 'BIGINT UNSIGNED', 'Number of background write I/O threads in InnoDB.', '1', '64', '0', NULL, 'YES', 'REQUIRED'),
('INNODB_MONITOR_DISABLE', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Turn off a monitor counter', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED'),
('INNODB_CONCURRENCY_TICKETS', NULL, '5000', 'COMPILE-TIME', '5000', 'GLOBAL', 'BIGINT UNSIGNED', 'Number of times a thread is allowed to enter InnoDB within the same SQL query after it has once got the ticket', '1', '18446744073709551615', '0', NULL, 'NO', 'REQUIRED'),
('INNODB_LOG_ARCHIVE', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Deprecated and ignored; only exists to allow easier upgrade from earlier XtraDB versions.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
('INNODB_USE_GLOBAL_FLUSH_LOG_AT_TRX_COMMIT', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Deprecated and ignored; only exists to allow easier upgrade from earlier XtraDB versions.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'NONE'),
('INNODB_MAX_BITMAP_FILE_SIZE', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT UNSIGNED', 'Deprecated and ignored; only exists to allow easier upgrade from earlier XtraDB versions.', '0', '18446744073709551615', '0', NULL, 'NO', 'REQUIRED'),
('LARGE_PAGE_SIZE', NULL, '0', 'COMPILE-TIME', NULL, 'GLOBAL', 'INT UNSIGNED', 'If large page support is enabled, this shows the size of memory pages', '0', '4294967295', '1', NULL, 'YES', NULL),
('INNODB_FOREGROUND_PREFLUSH', NULL, 'DEPRECATED', 'COMPILE-TIME', 'DEPRECATED', 'GLOBAL', 'ENUM', 'Deprecated and ignored; only exists to allow easier upgrade from earlier XtraDB versions.', NULL, NULL, NULL, 'SYNC_PREFLUSH,EXPONENTIAL_BACKOFF,DEPRECATED', 'NO', 'OPTIONAL'),
('READ_RND_BUFFER_SIZE', '262144', '262144', 'COMPILE-TIME', '262144', 'SESSION', 'BIGINT UNSIGNED', 'When reading rows in sorted order after a sort, the rows are read through this buffer to avoid a disk seeks', '1', '2147483647', '1', NULL, 'NO', 'REQUIRED'),
('INNODB_FAKE_CHANGES', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'Deprecated and ignored; only exists to allow easier upgrade from earlier XtraDB versions.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL');
