INSERT INTO `VIEWS` (`TABLE_CATALOG`, `TABLE_SCHEMA`, `TABLE_NAME`, `VIEW_DEFINITION`, `CHECK_OPTION`, `IS_UPDATABLE`, `DEFINER`, `SECURITY_TYPE`, `CHARACTER_SET_CLIENT`, `COLLATION_CONNECTION`, `ALGORITHM`) VALUES
('def', 'northwind', 'Alphabetical list of products', 'select `northwind`.`Products`.`ProductID` AS `ProductID`,`northwind`.`Products`.`ProductName` AS `ProductName`,`northwind`.`Products`.`SupplierID` AS `SupplierID`,`northwind`.`Products`.`CategoryID` AS `CategoryID`,`northwind`.`Products`.`QuantityPerUnit` AS `QuantityPerUnit`,`northwind`.`Products`.`UnitPrice` AS `UnitPrice`,`northwind`.`Products`.`UnitsInStock` AS `UnitsInStock`,`northwind`.`Products`.`UnitsOnOrder` AS `UnitsOnOrder`,`northwind`.`Products`.`ReorderLevel` AS `ReorderLevel`,`northwind`.`Products`.`Discontinued` AS `Discontinued`,`northwind`.`Categories`.`CategoryName` AS `CategoryName` from (`northwind`.`Categories` join `northwind`.`Products` on(`northwind`.`Categories`.`CategoryID` = `northwind`.`Products`.`CategoryID`)) where `northwind`.`Products`.`Discontinued` = 0', 'NONE', 'YES', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Category Sales for 1997', 'select `Product Sales for 1997`.`CategoryName` AS `CategoryName`,sum(`Product Sales for 1997`.`ProductSales`) AS `CategorySales` from `northwind`.`Product Sales for 1997` group by `Product Sales for 1997`.`CategoryName`', 'NONE', 'NO', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Current Product List', 'select `northwind`.`Products`.`ProductID` AS `ProductID`,`northwind`.`Products`.`ProductName` AS `ProductName` from `northwind`.`Products` where `northwind`.`Products`.`Discontinued` = 0', 'NONE', 'YES', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Customer and Suppliers by City', 'select `northwind`.`Customers`.`City` AS `City`,`northwind`.`Customers`.`CompanyName` AS `CompanyName`,`northwind`.`Customers`.`ContactName` AS `ContactName`,''Customers'' AS `Relationship` from `northwind`.`Customers` union select `northwind`.`Suppliers`.`City` AS `City`,`northwind`.`Suppliers`.`CompanyName` AS `CompanyName`,`northwind`.`Suppliers`.`ContactName` AS `ContactName`,''Suppliers'' AS `Suppliers` from `northwind`.`Suppliers` order by `City`,`CompanyName`', 'NONE', 'NO', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Invoices', 'select `northwind`.`Orders`.`ShipName` AS `ShipName`,`northwind`.`Orders`.`ShipAddress` AS `ShipAddress`,`northwind`.`Orders`.`ShipCity` AS `ShipCity`,`northwind`.`Orders`.`ShipRegion` AS `ShipRegion`,`northwind`.`Orders`.`ShipPostalCode` AS `ShipPostalCode`,`northwind`.`Orders`.`ShipCountry` AS `ShipCountry`,`northwind`.`Orders`.`CustomerID` AS `CustomerID`,`northwind`.`Customers`.`CompanyName` AS `CustomerName`,`northwind`.`Customers`.`Address` AS `Address`,`northwind`.`Customers`.`City` AS `City`,`northwind`.`Customers`.`Region` AS `Region`,`northwind`.`Customers`.`PostalCode` AS `PostalCode`,`northwind`.`Customers`.`Country` AS `Country`,`northwind`.`Employees`.`FirstName` + '' '' + `northwind`.`Employees`.`LastName` AS `Salesperson`,`northwind`.`Orders`.`OrderID` AS `OrderID`,`northwind`.`Orders`.`OrderDate` AS `OrderDate`,`northwind`.`Orders`.`RequiredDate` AS `RequiredDate`,`northwind`.`Orders`.`ShippedDate` AS `ShippedDate`,`northwind`.`Shippers`.`CompanyName` AS `ShipperName`,`northwind`.`Order Details`.`ProductID` AS `ProductID`,`northwind`.`Products`.`ProductName` AS `ProductName`,`northwind`.`Order Details`.`UnitPrice` AS `UnitPrice`,`northwind`.`Order Details`.`Quantity` AS `Quantity`,`northwind`.`Order Details`.`Discount` AS `Discount`,`northwind`.`Order Details`.`UnitPrice` * `northwind`.`Order Details`.`Quantity` * (1 - `northwind`.`Order Details`.`Discount`) / 100 * 100 AS `ExtendedPrice`,`northwind`.`Orders`.`Freight` AS `Freight` from (((((`northwind`.`Customers` join `northwind`.`Orders` on(`northwind`.`Customers`.`CustomerID` = `northwind`.`Orders`.`CustomerID`)) join `northwind`.`Employees` on(`northwind`.`Employees`.`EmployeeID` = `northwind`.`Orders`.`EmployeeID`)) join `northwind`.`Order Details` on(`northwind`.`Orders`.`OrderID` = `northwind`.`Order Details`.`OrderID`)) join `northwind`.`Products` on(`northwind`.`Products`.`ProductID` = `northwind`.`Order Details`.`ProductID`)) join `northwind`.`Shippers` on(`northwind`.`Shippers`.`ShipperID` = `northwind`.`Orders`.`ShipVia`))', 'NONE', 'YES', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Order Details Extended', 'select `northwind`.`Order Details`.`OrderID` AS `OrderID`,`northwind`.`Order Details`.`ProductID` AS `ProductID`,`northwind`.`Products`.`ProductName` AS `ProductName`,`northwind`.`Order Details`.`UnitPrice` AS `UnitPrice`,`northwind`.`Order Details`.`Quantity` AS `Quantity`,`northwind`.`Order Details`.`Discount` AS `Discount`,`northwind`.`Order Details`.`UnitPrice` * `northwind`.`Order Details`.`Quantity` * (1 - `northwind`.`Order Details`.`Discount`) / 100 * 100 AS `ExtendedPrice` from (`northwind`.`Products` join `northwind`.`Order Details` on(`northwind`.`Products`.`ProductID` = `northwind`.`Order Details`.`ProductID`))', 'NONE', 'YES', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Order Subtotals', 'select `northwind`.`Order Details`.`OrderID` AS `OrderID`,sum(`northwind`.`Order Details`.`UnitPrice` * `northwind`.`Order Details`.`Quantity` * (1 - `northwind`.`Order Details`.`Discount`) / 100 * 100) AS `Subtotal` from `northwind`.`Order Details` group by `northwind`.`Order Details`.`OrderID`', 'NONE', 'NO', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Products Above Average Price', 'select `northwind`.`Products`.`ProductName` AS `ProductName`,`northwind`.`Products`.`UnitPrice` AS `UnitPrice` from `northwind`.`Products` where `northwind`.`Products`.`UnitPrice` > (select avg(`northwind`.`Products`.`UnitPrice`) from `northwind`.`Products`)', 'NONE', 'YES', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Products by Category', 'select `northwind`.`Categories`.`CategoryName` AS `CategoryName`,`northwind`.`Products`.`ProductName` AS `ProductName`,`northwind`.`Products`.`QuantityPerUnit` AS `QuantityPerUnit`,`northwind`.`Products`.`UnitsInStock` AS `UnitsInStock`,`northwind`.`Products`.`Discontinued` AS `Discontinued` from (`northwind`.`Categories` join `northwind`.`Products` on(`northwind`.`Categories`.`CategoryID` = `northwind`.`Products`.`CategoryID`)) where `northwind`.`Products`.`Discontinued` <> 1', 'NONE', 'YES', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Quarterly Orders', 'select distinct `northwind`.`Customers`.`CustomerID` AS `CustomerID`,`northwind`.`Customers`.`CompanyName` AS `CompanyName`,`northwind`.`Customers`.`City` AS `City`,`northwind`.`Customers`.`Country` AS `Country` from (`northwind`.`Customers` join `northwind`.`Orders` on(`northwind`.`Customers`.`CustomerID` = `northwind`.`Orders`.`CustomerID`)) where `northwind`.`Orders`.`OrderDate` between ''1997-01-01'' and ''1997-12-31''', 'NONE', 'NO', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Sales Totals by Amount', 'select `Order Subtotals`.`Subtotal` AS `SaleAmount`,`northwind`.`Orders`.`OrderID` AS `OrderID`,`northwind`.`Customers`.`CompanyName` AS `CompanyName`,`northwind`.`Orders`.`ShippedDate` AS `ShippedDate` from ((`northwind`.`Customers` join `northwind`.`Orders` on(`northwind`.`Customers`.`CustomerID` = `northwind`.`Orders`.`CustomerID`)) join `northwind`.`Order Subtotals` on(`northwind`.`Orders`.`OrderID` = `Order Subtotals`.`OrderID`)) where `Order Subtotals`.`Subtotal` > 2500 and `northwind`.`Orders`.`ShippedDate` between ''1997-01-01'' and ''1997-12-31''', 'NONE', 'YES', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Orders Qry', 'select `northwind`.`Orders`.`OrderID` AS `OrderID`,`northwind`.`Orders`.`CustomerID` AS `CustomerID`,`northwind`.`Orders`.`EmployeeID` AS `EmployeeID`,`northwind`.`Orders`.`OrderDate` AS `OrderDate`,`northwind`.`Orders`.`RequiredDate` AS `RequiredDate`,`northwind`.`Orders`.`ShippedDate` AS `ShippedDate`,`northwind`.`Orders`.`ShipVia` AS `ShipVia`,`northwind`.`Orders`.`Freight` AS `Freight`,`northwind`.`Orders`.`ShipName` AS `ShipName`,`northwind`.`Orders`.`ShipAddress` AS `ShipAddress`,`northwind`.`Orders`.`ShipCity` AS `ShipCity`,`northwind`.`Orders`.`ShipRegion` AS `ShipRegion`,`northwind`.`Orders`.`ShipPostalCode` AS `ShipPostalCode`,`northwind`.`Orders`.`ShipCountry` AS `ShipCountry`,`northwind`.`Customers`.`CompanyName` AS `CompanyName`,`northwind`.`Customers`.`Address` AS `Address`,`northwind`.`Customers`.`City` AS `City`,`northwind`.`Customers`.`Region` AS `Region`,`northwind`.`Customers`.`PostalCode` AS `PostalCode`,`northwind`.`Customers`.`Country` AS `Country` from (`northwind`.`Customers` join `northwind`.`Orders` on(`northwind`.`Customers`.`CustomerID` = `northwind`.`Orders`.`CustomerID`))', 'NONE', 'YES', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Product Sales for 1997', 'select `northwind`.`Categories`.`CategoryName` AS `CategoryName`,`northwind`.`Products`.`ProductName` AS `ProductName`,sum(`northwind`.`Order Details`.`UnitPrice` * `northwind`.`Order Details`.`Quantity` * (1 - `northwind`.`Order Details`.`Discount`) / 100 * 100) AS `ProductSales` from (((`northwind`.`Categories` join `northwind`.`Products` on(`northwind`.`Categories`.`CategoryID` = `northwind`.`Products`.`CategoryID`)) join `northwind`.`Order Details` on(`northwind`.`Products`.`ProductID` = `northwind`.`Order Details`.`ProductID`)) join `northwind`.`Orders` on(`northwind`.`Orders`.`OrderID` = `northwind`.`Order Details`.`OrderID`)) where `northwind`.`Orders`.`ShippedDate` between ''1997-01-01'' and ''1997-12-31'' group by `northwind`.`Categories`.`CategoryName`,`northwind`.`Products`.`ProductName`', 'NONE', 'NO', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Sales by Category', 'select `northwind`.`Categories`.`CategoryID` AS `CategoryID`,`northwind`.`Categories`.`CategoryName` AS `CategoryName`,`northwind`.`Products`.`ProductName` AS `ProductName`,sum(`Order Details Extended`.`ExtendedPrice`) AS `ProductSales` from (((`northwind`.`Categories` join `northwind`.`Products` on(`northwind`.`Categories`.`CategoryID` = `northwind`.`Products`.`CategoryID`)) join `northwind`.`Order Details Extended` on(`northwind`.`Products`.`ProductID` = `Order Details Extended`.`ProductID`)) join `northwind`.`Orders` on(`northwind`.`Orders`.`OrderID` = `Order Details Extended`.`OrderID`)) where `northwind`.`Orders`.`OrderDate` between ''1997-01-01'' and ''1997-12-31'' group by `northwind`.`Categories`.`CategoryID`,`northwind`.`Categories`.`CategoryName`,`northwind`.`Products`.`ProductName`', 'NONE', 'NO', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Summary of Sales by Quarter', 'select `northwind`.`Orders`.`ShippedDate` AS `ShippedDate`,`northwind`.`Orders`.`OrderID` AS `OrderID`,`Order Subtotals`.`Subtotal` AS `Subtotal` from (`northwind`.`Orders` join `northwind`.`Order Subtotals` on(`northwind`.`Orders`.`OrderID` = `Order Subtotals`.`OrderID`)) where `northwind`.`Orders`.`ShippedDate` is not null', 'NONE', 'YES', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED'),
('def', 'northwind', 'Summary of Sales by Year', 'select `northwind`.`Orders`.`ShippedDate` AS `ShippedDate`,`northwind`.`Orders`.`OrderID` AS `OrderID`,`Order Subtotals`.`Subtotal` AS `Subtotal` from (`northwind`.`Orders` join `northwind`.`Order Subtotals` on(`northwind`.`Orders`.`OrderID` = `Order Subtotals`.`OrderID`)) where `northwind`.`Orders`.`ShippedDate` is not null', 'NONE', 'YES', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci', 'UNDEFINED');
